current_key = 5
password = ""
code = ["",
        "",
        "",
        "",
        ""
        ]

for instruction in code:
    for step in instruction:
        if step == 'U':
            if current_key - 3 > 0:
                current_key -= 3
        elif step == 'D':
            if current_key + 3 <= 9:
                current_key += 3
        elif step == 'L':
            if current_key not in [1, 4, 7]:
                if current_key - 1 > 0:
                    current_key -= 1
        elif step == 'R':
            if current_key not in [3, 6, 9]:
                if current_key + 1 <= 9:
                    current_key += 1

    password += str(current_key)

print(password)
